description:
Chính chủ cần cho thuê căn hộ LEMAN 117 Nguyễn Đình Chiểu, Phường 6, Quận 3, Thành phố Hồ Chí Minh, nằm tại tòa nhà (LEMAN LUXURY BUILDING) :
- Diện tích: 75m2;
- 02 phòng ngủ;
- 01 nhà vệ sinh
- Đã có tiện ích đầy đủ, full nội thất cao cấp, ngay trung tâm thành phố, nơi có dân trí và an ninh rất cao;
- Nhà mới mua có thể dọn vào ở liền.
- Giá thuê 27 triệu/tháng, ưu tiên kí hợp đồng 1-2 năm dài hạn.
